    "whistling-swan-dyeing-program-malheur-national-wildlife-refuge-fall-1961-spring-1962",nt"isopen":
    false,nt"url": null,nt"notes": "This report covers the whistling swan dyeing
    program on Malheur National Wildlife Refuge, in the fall of 1961 to trap birds which,
    owing to the absence of food in Malheur Lake and low water conditions resulting
    from three consecutive years of drought, began coming in to feed on grain placed
    for pinioned birds in the display pool. Attached are a table listing observation
    data and a map showing sites where observations were made. The map depicts site
    only and approximate dates for observations in the United States and southern Canada.
    In some places, notably near Sacramento, Tulelake, Malheur Lake, and Flathead Lake,
    there were a number of observations too close to be clearly shown.",nt"license_title":
